INSERT INTO `news` (`id`, `title`, `photo`, `description`, `status`, `datetime`, `meta_keyword`, `meta_description`, `added`, `updated`, `priority`) VALUES
(10, 'The Importance of E-commerce Store', 'news/8385621860.jpeg', 'In the current scenario of the Covid-19 pandemic pandemic, where there are nationwide lockdowns, E-Commerce has become increasingly important because of all its advantages for sellers and buyers alike.\r\n\r\nEven traditional retailers set up a few websites during the pandemic to maintain business continuity. This augurs well for e-commerce all over the world. It is possible now to buy everything from groceries to sports equipment online.\r\n\r\nIn India alone, e-commerce sales are growing at about 51% a year. Globally, e-commerce sales increased by 77% over last year.', 1, NULL, 'ecommerce , online products selling , ecommerce in kanpur , ecommerce provider in kanpur', 'The Importance of ecommerce', '2022-03-10 07:38:16', '2022-03-10 07:45:26', '0.3'),
(11, 'Best Ecommerce Solution in India', 'news/6707306884.png', 'Shopzone247 is the ecommerce solution in India. Our solutions are designed to meet the needs of Indian consumers. The solution is robust and very cost-effective, so anyone can start their ecommerce business with no hassle.', 1, NULL, 'ecommerce , online products selling , ecommerce in kanpur , ecommerce provider in kanpur, ecommerce ', 'Best Ecommerce Solution in India', '2022-04-07 19:50:17', NULL, '0.3');
