(6, 'Pharma App Shop', 1, 1, 'Kanpur Nagar', 'Kidwai Nagar', '208014', 'Birhana Road', '9839266656', '9451009260', '######', 'pharma@gmail.com', '80.311345', '26.430556', 1, 1, 1, '10:00:00', '20:00:00', '2023-04-14 10:00:00', '2020-06-24 07:00:00', 1, 1, 6, 'NOT_DELETED', 0, 9, '123456', 'shopphoto/logo.png', 1, '', 'rzp_test_nUbt3efrIjdQ3h', '8EfbgeO8MQBxRprBANmFglR5', '100.00', '<span style=\"color:#000\">\r\n<strong>About Us</strong>\r\n<p style=\"color:#000\">\r\nSheffield Vape Outlet is your go-to online and in-store outlet to supply you with quality vape products at everyday low prices!\r\n</p>\r\n\r\n<p style=\"color:#000\">\r\nWe bask in stocking a whopping range of Disposable Vape Devices, Vape\r\nKits, Hardware and more. Our volume of products may seem overwhelming, however, having a large range of products is essential for us to cater to all of our customers. No\r\n \r\nVaper is the same and we aim to serve every kind!\r\n</p>\r\n\r\n<p style=\"color:#000\">\r\nSheffield Vape Outlet was born out of a desire to provide an informative and efficient online shopping experience for smokers looking to make the switch to vaping .</p>\r\n\r\n<p style=\"color:#000\">\r\nThe world of electronic cigarettes and vaping devices has evolved - and continues to grow - at a rapid rate. It can certainly be a confusing journey and we find great satisfaction in not\r\nonly supplying our valued customers with high-quality products but also offering in-house support and guidance wherever needed.\r\n</p>\r\n<p style=\"color:#000\">\r\nCustomer safety, business legitimacy and lawfulness is essential to us. We take great pride in committing ourselves to fully TPD Complaint Products - an act brought in by the UK and European governments to regulate the advertising/sales of electronic cigarette products. All products listed in-store and online here at Sheffield Vape outlet are fully\r\ncompliant with these regulations. Not only that, we are devoted to educating, informing and protecting the public against any unregulated products they may come into contact with.</p>\r\n<p style=\"color:#000\">\r\nWe dont just pride ourselves in being a vaping retailer but most importantly a community of vaping enthusiasts who vape exactly what we sell. Thats right! If we didnt vape it, we wouldnt sell it. You can expect 100% honesty and transparency when under our wing.\r\n</p>\r\n</span>', 0, 'e10adc3949ba59abbe56e057f20f883e', 2, '6Ld5CbYeAAAAAOV0p1TrPqgH1AbdoC7_B2tTrP39', '6Ld5CbYeAAAAAHsP5zqNRDGkWNrkv7sxNlZjOjj7', '', 0, 1, 24, '', '', '', 'AIzaSyDIHyFm0c8apzuuVZE4zsFXbGDfXRyPsv4', 'pound', 'pence', '20.00');
